import React from "react";
import Overview from "./overview";
import Register from './register';
import Background from "./background.jpg";
import NavBar from "./navbar";

class Home extends React.Component {
    constructor(props) {
        super(props);

        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(event) {
        if(event.target.value === 'register'){
            this.props.setActivePage("register");
        }
        if(event.target.value === 'overview'){
            this.props.setActivePage("overview");
        }
    }

    render() {
        return (
            <div>
                <img id="background" src={ Background } alt="" />
                <div className="navBar">
                    <NavBar />
                </div>
                <div className="register_box" >
                    <h2 className="text-center text-white">Logget inn som: <b>[Username]</b></h2>
                    <br></br>
                    <div className="d-flex flex-row bd-highlight mb-2 justify-content-center">
                        <div className="p-2">
                            <button onClick={this.handleClick} type="button" value="register" className="home-button btn btn-primary btn-lg">Ny melding</button>;
                        </div>
                        <div className="p-2">
                            <button onClick={this.handleClick} type="button" value="overview" className="home-button btn btn-primary btn-lg">Aktive meldinger</button>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
